(254, 1, '2020-04-06 09:44:38', '2020-04-06 06:44:38', 'The material this shirt is made of is super soft! Very pretty mustard color and the white trim is nice added touch. I love the design and how it fits. This is a woman’s fit T-shirt so it’s more form fitting then the unisex style T-shirt’s. Very comfortable to wear and well made. This is definitely not one of those cheaply made shirts, it’s great quality!', 'Nlife Bring On The Sunshine Graphic Long Sleeves Tees Blouses for Women Tops Sweaters for Women', '<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n 	<li><span class=\"a-list-item\">Do Not Bleach</span></li>\r\n 	<li><span class=\"a-list-item\">Material：Cotton 80% and Polyester 20%. High quality material, soft fabric with a little stretchy and light weight.</span></li>\r\n 	<li><span class=\"a-list-item\">Features: New funny letter print design, round neck, short sleeve.</span></li>\r\n 	<li><span class=\"a-list-item\">This T-shirt is easy to match with jeans, skinny jeans, shorts and black pants.</span></li>\r\n 	<li><span class=\"a-list-item\">Garment Care: Suggest to hand wash in cold water. Dry flat and do not bleach.</span></li>\r\n 	<li><span class=\"a-list-item\">Please refer to size measurement in the last picture before ordering.</span></li>\r\n</ul>', 'inherit', 'closed', 'closed', '', '241-autosave-v1', '', '', '2020-04-06 09:44:38', '2020-04-06 06:44:38', '', 241, 'http://wp-shop.local/241-autosave-v1/', 0, 'revision', '', 0),
(255, 1, '2020-04-06 09:51:35', '2020-04-06 06:51:35', 'Heavyweight 6.75 ounce short sleeve pocket tee with tag less back neck for comfort', 'Dickies Men\'s Short Sleeve Heavyweight Crew Neck Pocket Tee', '<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n 	<li><span class=\"a-list-item\">100% heavyweight cotton jersey</span></li>\r\n 	<li><span class=\"a-list-item\">0.7\" high</span></li>\r\n 	<li><span class=\"a-list-item\">14\" wide</span></li>\r\n 	<li><span class=\"a-list-item\">SUPERIOR COMFORT FIT: Our classic crewneck pocket tee is made of 100% heavyweight, soft jersey-knit cotton. Extra-strong taped shoulder &amp; neck seams for added durability. Tagless labeling eliminates chafing. Long tail looks good tucked or untucked.</span></li>\r\n 	<li><span class=\"a-list-item\">STURDY FUNCTIONALITY: This 100% preshrunk cotton shirt features a traditional chest pocket with pencil divider &amp; a spacious fit with a long tail for all kinds of work activity. It\'s a sturdy, basic t-shirt that can be worn either alone or as an undershirt</span></li>\r\n 	<li><span class=\"a-list-item\">CLASSIC FAVORITE: Fans tell us our sturdy, tagless t-shirts are the ones by which all others should be measured. Try one on and see for yourself! You can wear it alone or as an undershirt, in a wide selection of colors &amp; regular or big and tall sizes.</span></li>\r\n 	<li><span class=\"a-list-item\">TRUSTED NAME: The world\'s leading performance workwear brand, Dickies has been making quality workwear &amp; apparel since 1922. All Dickies clothing offers superior craftsmanship &amp; unmatched value to deliver classic style &amp; long-lasting comfort every day.</span></li>\r\n 	<li><span class=\"a-list-item\">We make jeans, outerwear, school &amp; work uniforms, sports shirts, kids wear, hats, socks, underwear, boots, gloves, belts, eyewear, backpacks, bags &amp; much more.</span></li>\r\n</ul>', 'publish', 'open', 'closed', '', 'dickies-mens-short-sleeve-heavyweight-crew-neck-pocket-tee', '', '', '2020-05-20 12:42:08', '2020-05-20 09:42:08', '', 0, 'http://wp-shop.local/?post_type=product&#038;p=255', 0, 'product', '', 0),
