(269, 1, '2020-04-06 09:56:16', '2020-04-06 06:56:16', 'For more than 90 years, Champion athletic wear has outfitted athletes in authentic athletic apparel before, during and after the game.', 'Champion Men\'s Classic Jersey Script T-Shirt', '<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n 	<li><span class=\"a-list-item\">100% Cotton</span></li>\r\n 	<li><span class=\"a-list-item\">Imported</span></li>\r\n 	<li><span class=\"a-list-item\">Cotton lining</span></li>\r\n 	<li><span class=\"a-list-item\">Pull On closure</span></li>\r\n 	<li><span class=\"a-list-item\">Machine Wash</span></li>\r\n 	<li><span class=\"a-list-item\">0.7\" high</span></li>\r\n 	<li><span class=\"a-list-item\">14\" wide</span></li>\r\n</ul>\r\n<div class=\"a-row a-expander-container a-expander-inline-container\" aria-live=\"polite\">\r\n<div class=\"a-expander-content a-expander-extend-content a-expander-content-expanded\" aria-expanded=\"true\">\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n 	<li><span class=\"a-list-item\">Ring spun cotton fabric for extra softness. Oxford 90 percent cotton/10 percent polyester, trim</span></li>\r\n 	<li><span class=\"a-list-item\">Athletic fit for comfort</span></li>\r\n 	<li><span class=\"a-list-item\">Narrow collar for a more modern fit</span></li>\r\n 	<li><span class=\"a-list-item\">Left chest \'C\' logo and C patch on sleeve</span></li>\r\n 	<li><span class=\"a-list-item\">Available in solids and graphics</span></li>\r\n</ul>\r\n</div>\r\n</div>', 'publish', 'open', 'closed', '', 'champion-mens-classic-jersey-script-t-shirt', '', '', '2020-05-20 12:44:01', '2020-05-20 09:44:01', '', 0, 'http://wp-shop.local/?post_type=product&#038;p=269', 0, 'product', '', 0),
