(297, 1, '2020-04-06 10:43:38', '2020-04-06 07:43:38', 'BROOKLYN ATHLETICS apparel draws inspiration from the East Coast surf and skate scenes Clothing designed for individuals whose lifestyles are active functional and adventurous Designs feature modern and innovative details that appeal to everyone Cotton poplin and modern fit provide added comfort ideal for warmer weather Sizing is designed for a slim and athletic fit We recommend ordering a size larger for a loose fit Model shown is 6\'1\" with an athletic build wearing a size medium Our button down casual shirts feature unique reverse prints and vintage faded designs in Hawaiian inspired colors and graphics Shirt details include a front utility pocket and scoop hem Syncs up effortlessly with your everyday style Perfect for casual wear summer beach days everyday use lounging around the house or anything in between Available in a variety of colors and patterns in regular sizes (S to XXL) See size chart for measurements to choose your fit Lightweight and breathable material gives this button down shirt a soft comfortable feel Made from 60% Cotton 40% Polyester We stand by the quality of our apparel and includes no hassle 100% money back if not satisfied The cotton poplin fabric provides a comfortable and stylish fit for year round wear These hawaiian shirts for men are available in a variety of colors and sizes so you can definitely find a shirt that you\'ll love Colors Available Aqua Leaves Black Palm Black Pineapple Blue Pattern Navy/Pink Flamingo Red Floral Black/Pink Floral Light Blue Floral Light Pink Palms Tourquoise Pineapple White Tie Dye Palms Sizes Available Small Medium Large X-Large XX-Large', 'Brooklyn Athletics Men\'s Hawaiian Aloha Shirt Vintage Casual Button Down Tee', '<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n 	<li><span class=\"a-list-item\">Button closure</span></li>\r\n 	<li><span class=\"a-list-item\">BROOKLYN ATHLETICS Our apparel draws inspiration from the East Coast surf and skate scenes Clothing designed for individuals whose lifestyles are active functional and adventurous Designs feature modern and innovative details that appeal to everyone</span></li>\r\n 	<li><span class=\"a-list-item\">COMFORTABLE FIT Cotton poplin and modern fit provide added comfort ideal for warmer weather Sizing is designed for a slim/athletic fit We recommend ordering a size larger for a loose fit Model shown is 6\'1\" with an athletic build wearing a size med</span></li>\r\n 	<li><span class=\"a-list-item\">STYLE AND DESIGN Our button down casual shirts feature unique reverse prints and vintage faded designs in Hawaiian inspired colors and graphics Shirt details include a front utility pocket and scoop hem Syncs up effortlessly with your everyday style</span></li>\r\n 	<li><span class=\"a-list-item\">FUNCTION AND SIZING Perfect for casual wear summer beach days everyday use lounging around the house or anything in between Available in a variety of colors and patterns in regular sizes (S to XXL) See size chart for measurements to choose your fit</span></li>\r\n 	<li><span class=\"a-list-item\">MATERIAL AND FABRIC Lightweight and breathable material gives this button down shirt a soft comfortable feel Made from 60% Cotton 40% Polyester We stand by the quality of our apparel and includes no hassle 100% money back if not satisfied</span></li>\r\n</ul>', 'publish', 'open', 'closed', '', 'brooklyn-athletics-mens-hawaiian-aloha-shirt-vintage-casual-button-down-tee', '', '', '2020-05-20 12:45:19', '2020-05-20 09:45:19', '', 0, 'http://wp-shop.local/?post_type=product&#038;p=297', 0, 'product', '', 0),
