INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `icon`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`) VALUES
(1, 'wc-admin-welcome-note', 'info', 'en_US', 'Новые возможности', 'Добро пожаловать в новую среду WooCommerce! В этом новом выпуске вы сможете на специальной консоли увидеть, как работает ваш магазин, управлять важными аспектами вашего бизнеса (такими как управление заказами, запасами, отзывами) из любой точки интерфейса, разобраться в данных, поступающих из вашего магазина, с помощью совершенно нового раздела аналитики и многое другое!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-03-22 11:00:38', NULL, 0),
(2, 'wc-admin-store-notice-setting-moved', 'info', 'en_US', 'Ищете настройки \"Уведомление магазина\"?', 'Это можно найти в конфигураторе.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-03-22 11:00:38', NULL, 0),
(3, 'wc-admin-add-first-product', 'info', 'en_US', 'Добавьте свой первый продукт', 'Увеличьте свой доход, добавив товары в ваш магазин. Добавьте продукты вручную, импортируйте из электронной таблицы или перенесите с другой платформы', 'product', '{}', 'unactioned', 'woocommerce-admin', '2020-03-22 11:00:38', NULL, 0),
(4, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Подключиться к WooCommerce.com', 'Подключайтесь, чтобы получать важные уведомления о продукте и обновления.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-03-22 11:00:38', NULL, 0),
(5, 'wc-admin-store-notice-giving-feedback', 'info', 'en_US', 'Просмотрите свой результат', 'Если вам нравится WooCommerce Admin, пожалуйста, поставьте нам оценку 5 звезд. Заранее благодарим!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-03-26 10:37:30', NULL, 0),
(6, 'wc-admin-mobile-app', 'info', 'en_US', 'Установите мобильное приложение Woo', 'Установите мобильное приложение WooCommerce для управления заказами, получения уведомлений о продажах и просмотра ключевых показателей — где бы вы ни находились.', 'phone', '{}', 'unactioned', 'woocommerce-admin', '2020-03-26 10:37:30', NULL, 0),
(7, 'wc-admin-facebook-extension', 'info', 'en_US', 'Маркетинг на Facebook', 'Развивайте свой бизнес, ориентируясь на нужных людей и стимулируя продажи с помощью Facebook. Вы можете установить это бесплатное расширение сейчас.', 'thumbs-up', '{}', 'unactioned', 'woocommerce-admin', '2020-03-26 10:37:30', NULL, 0),
(8, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Помогите WooCommerce стать лучше, согласившись делиться данными об использовании.', 'Сбор данных об использовании позволяет нам улучшить WooCommerce. Информация о вашем магазине будет использоваться для оценки новых функций, определения качества обновлений и принятия решений о целесообразности дальнейших улучшений. Вы всегда можете зайти в <a href=\"http://wp-shop.local/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Настройки</a> и выбрать отмену отправки ваших данных. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Читать подробнее</a> о том, какие данные мы собираем.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-04-05 09:49:03', NULL, 0);
